import '../App.css';
import location from '../location1.png'
import linkedin from '../linkedin1.png'
import git from '../git1.png'

class Contact extends Component {
  render() {
    return (

      <div >


<div class="container-fluid" id="contactdiv">
<div className="container">

<div class ="row">
<div class="col">
<p class="text-left" id="helloheading2">Contact Me</p>
</div>
</div>
<div class ="row">
<div class="col-lg-6 col-md-6 col-sm-12 col-xs-12">
<p class="text-left" id="singlepara">Hamadesigns@outlook.com <br/> 4434 S.Himalaya Cr. <br/> Aurora, Colorado </p>
</div>
</div>

<div class="container" id="footer">  </div>
</div>
</div>
</div>
    );
  }
}

export default Contact;
